Let's define a some simple actor using elfo and figure out what's happening. The simplest way to define an actor as a function. For example, let's define the simplest counter: use elfo::prelude::*; #[message]
pub struct Increment { pub delta: u32,
} #[message(ret = u32)]
pub struct GetValue; pub fn counter() -> Blueprint { ActorGroup::new().exec(|mut ctx| async move { // Private state of the actor. let mut value = 0; // The main actor loop: receive a message, handle it, repeat. // Returns `None` and breaks the loop if actor's mailbox is closed // (usually when the system terminates). while let Some(envelope) = ctx.recv().await { msg!(match envelope { Increment { delta } => { value += delta; }, // It's a syntax for requests. (GetValue, token) => { // ... and responses. ctx.respond(token, value); }, }) } })
} We haven't discussed actor groups yet, so don't pay attention for now. Instead, let's talk about other things in the example: ctx.recv() allows us to wait for the next message asynchronously. Thus, if the mailbox is empty, the actor will return control to the scheduler instead of spending CPU cycles or sleeping. msg! allows us to unpack envelopes and match against different types of messages. It's required, because Rust's match must include patterns for the same data type only. However, we want to support different messages, often defined in different crates. Also, reusing the match syntax is highly desired in order to work well with tooling like rustfmt and rust-analyzer. (RequestType, token) is the syntax for handling requests. token cannot be used more than once, thanks to Rust, so we cannot accidentally respond to the request twice. Also, the compiler will warn if we forget to handle token. If the token is explicitly dropped without responding, the sending side will get the special error and decide whether it's normal or not. Note that it is possible to send request as a regular message using ctx.send() instead of ctx.request(). In this case, recipient will get a so-called "forgotten" token. Recipient can still reply using it, but the reply will be discarded before it is sent. Now let's define another actor to communicate with the counter: use elfo::prelude::*;
use counter::{Increment, GetValue}; pub fn sample() -> Blueprint { ActorGroup::new().exec(|ctx| async move { // Increment the counter, we aren't interested in errors. let _ = ctx.send(Increment { delta: 1 }).await; // ... and again. let _ = ctx.send(Increment { delta: 3 }).await; // Request the current counter's value and wait for the response. if let Ok(value) = ctx.request(GetValue).resolve().await { tracing::info!(value, "got it!"); } }
} We haven't connected our actors in any way, this will be discussed later. Note: it's more useful to write complex actors in another way, which will be considered later in the Structural Actors section.

