In instances where you need to adjust the timer's interval, possibly as a result of configuration changes, the interval.set_period() method comes in handy: use elfo::{time::Interval, messages::ConfigUpdated}; #[message]
struct MyTick; // adhering to best practice by using the 'Tick' suffix let interval = ctx.attach(Interval::new(MyTick));
interval.start(ctx.config().period); while let Some(envelope) = ctx.recv().await { msg!(match envelope { ConfigUpdated => { interval.set_period(ctx.config().period); }, MyTick => { /* handling code here */ }, });
} To halt the timer without detaching the interval, use interval.stop(). This method differs from interval.terminate() as it allows for the possibility to restart the timer later using interval.start(period) or start_after(delay, period) methods. It's essential to note that calling interval.start() at different points can yield varied behavior compared to invoking interval.set_period() on an already active interval. The interval.set_period() method solely modifies the existing interval without resetting the time origin, contrasting with the rescheduling functions (start_* methods). Here's a visual representation to illustrate the differences between these two approaches: set_period(10s): | 5s | 5s | 5s | # 10s | 10s |
