Sometimes the content of messages is too large, for instance, in writing a backend for graph plotting, where every response can contain thousands of points. We don't want to lose additional information about responses, but saving whole messages is very expensive in this case. For this situation, elfo provides a helper to hide specified fields during serialization, but only in the dumping context. So, these messages still will be properly sent over the network, where serialization is used too. #[message]
pub struct ChunkProduced { pub graph_id: GraphId, #[serde(serialize_with = "elfo::dumping::hide")] pub points: Vec<(f64, f64)>, // will be dumped as "<hidden>"
} Such messages cannot be deserialized properly; that's ok until they are used as input for [regression testing][regression].

